-- Each token has type: AlexPosn -> String -> Token
-- The token type
data Token = 
        TIdent AlexPosn String
        | TReservedOp AlexPosn
        | THexNum AlexPosn
        | TExp AlexPosn Int
        | TIntLit AlexPosn Int
        | TInt AlexPosn Int
        | TDec AlexPosn Int
        | TStringLiteral AlexPosn String
        | TPragma AlexPosn
        | TImport AlexPosn
        | TContract AlexPosn
        | TFuncDef AlexPosn
        | TPublic AlexPosn String                   -- In order to pass through the value of the token, as opposed to the token position.
        | TIntern AlexPosn String
        | TPriv AlexPosn String
        | TConst AlexPosn String
        | TStringAs AlexPosn String
        | TAddr AlexPosn String
        | TVar AlexPosn String
        | TBooleanLit AlexPosn String
        | TTrue AlexPosn
        | TFalse AlexPosn
        | TAs AlexPosn
        | TVers AlexPosn
        | THat AlexPosn
        | TNegate AlexPosn
        | TAnd AlexPosn
        | TOr AlexPosn
        | TInEqual AlexPosn
        | TLThan AlexPosn
        | TGThan AlexPosn
        | TLTEq AlexPosn
        | TGTEq  AlexPosn
        | TEquality AlexPosn
        | TLCurl AlexPosn
        | TRCurl AlexPosn
        | TLBrack AlexPosn
        | TRBrack AlexPosn
        | TBytes AlexPosn
        | TLeftParen AlexPosn
        | TRightParen AlexPosn
        | TPeriod AlexPosn
        | TEquals AlexPosn
        | TMult AlexPosn
        | TDiv AlexPosn
        | TExpSym AlexPosn
        | TModul AlexPosn
        | TOp AlexPosn Char
        | TSub AlexPosn
        | TSemiCol AlexPosn
        deriving (Eq, Show)

